fr:mainmatter.fr:p:
Let (C, \otimes , I, \alpha , \lambda , \rho ) be a monoidal category.
    The free monoid on an object X in C is a monoid 
    (F, m_F, e_F) together with a morphism \text {ins} : X\to  F 
    (insertion of generators)
    such that for any monoid (G, m_G, e_G) and any 
    morphism f : X \to  G there exist a unique 
    monoid homomorphism \text {free}(f) : F \to  G that makes 
    the following diagram commute:





