        \begin {tikzcd}
            X && F \\
            \\
            && G
            \arrow ["{\text {ins}}", from=1-1, to=1-3]
            \arrow ["f"', from=1-1, to=3-3]
            \arrow ["{\text {free}(f)}", dashed, from=1-3, to=3-3]
        \end {tikzcd}

A monoid category is a tuple 
    (C, \otimes , I, \alpha , \lambda , \rho ) where

C is a category

\otimes  is a bifunctor C \times  C \to  C

I is an object in C

\alpha , \lambda , \rho  are natural isomorphism (associator)
                             \begin {align*}                     \alpha _{A, B, C} &: (A \otimes  B) \otimes  C \to  A \otimes  (B \otimes  C) \\                     \lambda _A &: I \otimes  A \to  A \\                     \rho _A &: A \otimes  I \to  A                 \end {align*}             
            such that \lambda _I = \rho _I and the following diagrams commute:





