                \begin {tikzcd}
                    {A\otimes  (I\otimes  B)} && {(A\otimes  I)\otimes  B} \\
                    \\
                    & {A\otimes  B}
                    \arrow ["\alpha ", from=1-1, to=1-3]
                    \arrow ["{\text {id}\otimes  A}"', from=1-1, to=3-2]
                    \arrow ["{\rho \otimes \text {id}}", from=1-3, to=3-2]
                \end {tikzcd}

    A monoidal category is said to be strict when the 
    natural isomorphisms \alpha , \lambda , \rho  are identities.
    With additional natural isomorphism \gamma _{A,B}:A\otimes  B\to  B\otimes  A 
    and some coherence conditions, we get a symmetric monoidal category.

A monoid in a monoidal category (C, \otimes , I, \alpha , \lambda , \rho ) 
    is a tuple (M, m, e) where m and e are morphisms in C.
             I \xrightarrow {e} M \xleftarrow {m} M \otimes  M     
    such that the following diagrams commute:





